                    <div className="form-group">
                        <label  >Email </label>
                        <input name="name" className="form-control" /> 
                    </div>
                    <div className="form-group">
                        <label  >Password </label>
                        <input name="name" className="form-control" /> 
                    </div>
                    <button type="submit" className="btn btn-primary">Submit</button>
                </form>
            </div>
        )
    }
}
